INSERT INTO `pages` (`Lingua`, `ID`, `Nome`, `Dir`, `TrueDir`, `Descrizione`) VALUES
(1, 1, 'Skalmold', '/PrjWiki/BraveFrontierWiki/Skalmold/Italiano', '/PrjWiki/PAGINE/Italiano/Skalmold.php', 'Dei temibili guerrieri provenienti dai più freddi territori di Grand Gaia. La leggenda narra di sei eccezionali semidee incaricate di selezionare i più valorosi tra i combattenti in punto di morte e di garantire loro l\'accesso al paradiso affinchè le loro anime possano lottare al fianco delle divinità. Skalmold non è più degna del suo titolo divino. traditrice della sua stirpe, assassina del suo amore, nessuno sa come sia riuscita ad evitare la morte.'),
(1, 2, 'Svafa', '/PrjWiki/BraveFrontierWiki/Svafa/Italiano', '/PrjWiki/PAGINE/Italiano/Svafa.php', 'Dei temibili guerrieri provenienti dai più freddi territori di Grand Gaia. La leggenda narra di sei eccezionali semidee incaricate di selezionare i più valorosi tra i combattenti in punto di morte e di garantire loro l\'accesso al paradiso affinchè le loro anime possano lottare al fianco delle divinità. Svafa ora è l\'autentica incarnazione del potere dei mari. Può evocare a volontà qualsiasi creatura dell\'abisso e scatenarne la collera.'),
(1, 3, 'Eir', '/PrjWiki/BraveFrontierWiki/Eir/Italiano', '/PrjWiki/PAGINE/Italiano/Eir.php', 'Dei temibili guerrieri provenienti dai più freddi territori di Grand Gaia. La leggenda narra di sei eccezionali semidee incaricate di selezionare i più valorosi tra i combattenti in punto di morte e di garantire loro l\'accesso al paradiso affinchè le loro anime possano lottare al fianco delle divinità. Eir ora ha deciso di partecipare alla guerra. Non è più solo una guaritrice, è in grado di coltivare semenze mostruose per divorare le anime sventurate che osano entrare nei suoi boschi.'),
(1, 4, 'Thrud', '/PrjWiki/BraveFrontierWiki/Thrud/Italiano', '/PrjWiki/PAGINE/Italiano/Thrud.php', 'Dei temibili guerrieri provenienti dai più freddi territori di Grand Gaia. La leggenda narra di sei eccezionali semidee incaricate di selezionare i più valorosi tra i combattenti in punto di morte e di garantire loro l\'accesso al paradiso affinchè le loro anime possano lottare al fianco delle divinità. Ormai quasi potente quanto suo padre, Thrud è comunque ancora umile e continua a fare del suo meglio per condurre in paradiso i guerrieri più meritevoli.'),
(1, 5, 'Alvitr', '/PrjWiki/BraveFrontierWiki/Alvitr/Italiano', '/PrjWiki/PAGINE/Italiano/Alvitr.php', 'Dei temibili guerrieri provenienti dai più freddi territori di Grand Gaia. La leggenda narra di sei eccezionali semidee incaricate di selezionare i più valorosi tra i combattenti in punto di morte e di garantire loro l\'accesso al paradiso affinchè le loro anime possano lottare al fianco delle divinità. Alvitr è più veloce che mai. Conduce innumerevoli anime al loro paradiso, e qualcuno ha persino cominciato a lamentarsi delle quantità!'),
(1, 6, 'Geirdriful', '/PrjWiki/BraveFrontierWiki/Geirdriful/Italiano', '/PrjWiki/PAGINE/Italiano/Geirdful.php', 'Dei temibili guerrieri provenienti dai più freddi territori di Grand Gaia. La leggenda narra di sei eccezionali semidee incaricate di selezionare i più valorosi tra i combattenti in punto di morte e di garantire loro l\'accesso al paradiso affinchè le loro anime possano lottare al fianco delle divinità. Geirdriful, in un momento di follia, bevve il sangue di Skalmold nel giorno in cui venne uccisa. Gli eroi ritornarono e uccisero anche lei. Ma una dea delle arti oscure può davvero essere così facile da sconfiggere? La gente sogna di corvi folli in cerca di strane fiamme...'),
(1, 7, 'Pagina_di_prova_n1', '/PrjWiki/BraveFrontierWiki/Pagina_di_prova_n1/Italiano', '/PrjWiki/PAGINE/Italiano/Pagina_di_prova_n1.php', 'Nulla vitae eros augue. Duis imperdiet leo ac finibus semper. Donec eu interdum ex. Nullam convallis nec enim sed fermentum. Nullam id nisi at quam gravida sollicitudin. Integer facilisis, magna vitae mollis efficitur, dolor urna fringilla metus, ut condimentum tortor leo vitae urna. Curabitur luctus condimentum iaculis. Cras ultrices mauris lacus, at scelerisque nulla sodales nec.'),
