(2, 1, 'Skalmold', '/PrjWiki/BraveFrontierWiki/Skalmold/English', '/PrjWiki/PAGINE/English/Skalmold.php', 'Fearsome warriors from the colder territories of Grand Gaia. The legend tells of six exceptional demigods in charge of selecting the bravest of the dying fighters and granting them access to paradise so that their souls can fight alongside the gods. Skalmold is no longer worthy of her divine title. traitor to her lineage, murderer of her love, no one knows how she managed to avoid death.'),
(2, 2, 'Svafa', '/PrjWiki/BraveFrontierWiki/Svafa/English', '/PrjWiki/PAGINE/English/Svafa.php', 'Fearsome warriors from the colder territories of Grand Gaia. The legend tells of six exceptional demigods charged with selecting the bravest of the dying fighters and guaranteeing access to paradise so that their souls can fight alongside the gods. Svafa is now the true embodiment of the power of the seas. Any creature of the abyss can summon a will and unleash its wrath.'),
(2, 3, 'Eir', '/PrjWiki/BraveFrontierWiki/Eir/English', '/PrjWiki/PAGINE/English/Eir.php', 'Fearsome warriors from the colder territories of Grand Gaia. The legend tells of six exceptional demigods in charge of selecting the bravest of the dying fighters and granting them access to paradise so that their souls can fight alongside the gods. Eir has now decided to join the war. She is no longer just a healer, she is able to cultivate monstrous seeds to devour the unfortunate souls who dare to enter her woods.'),
(2, 4, 'Thrud', '/PrjWiki/BraveFrontierWiki/Thrud/English', '/PrjWiki/PAGINE/English/Thrud.php', 'Fearsome warriors from the colder territories of Grand Gaia. The legend tells of six exceptional demigods charged with selecting the bravest of the dying fighters and guaranteeing them access to paradise so that their souls can fight alongside the gods. Now almost as powerful as his father, Thrud is still humble and continues to do his best to lead the most deserving warriors to heaven.'),
(2, 5, 'Alvitr', '/PrjWiki/BraveFrontierWiki/Alvitr/English', '/PrjWiki/PAGINE/English/Alvitr.php', 'Fearsome warriors from the colder territories of Grand Gaia. The legend tells of six exceptional demigods in charge of selecting the bravest of the dying fighters and granting them access to paradise so that their souls can fight alongside the gods. Alvitr is faster than ever. It leads countless souls to their heaven, and some have even begun to complain about quantities!'),
(2, 6, 'Geirdriful', '/PrjWiki/BraveFrontierWiki/Geirdriful/English', '/PrjWiki/PAGINE/English/Geridful.php', 'Fearsome warriors from the colder territories of Grand Gaia. The legend tells of six exceptional demigods charged with selecting the bravest of the dying fighters and guaranteeing them access to paradise so that their souls can fight alongside the gods. Geirdriful, in a moment of madness, drank Skalmold\'s blood on the day she was killed. The heroes returned and killed her too. But can a goddess of the dark arts really be that easy to defeat? People dream of crazy crows looking for strange flames ...'),
(2, 7, 'Pagina_di_prova_n1', '/PrjWiki/BraveFrontierWiki/Pagina_di_prova_n1/English', '/PrjWiki/PAGINE/English/Pagina_di_prova_n1.php', 'Nulla vitae eros augue. Duis imperdiet leo ac finibus semper. Donec eu interdum ex. Nullam convallis nec enim sed fermentum. Nullam id nisi at quam gravida sollicitudin. Integer facilisis, magna vitae mollis efficitur, dolor urna fringilla metus, ut condimentum tortor leo vitae urna. Curabitur luctus condimentum iaculis. Cras ultrices mauris lacus, at scelerisque nulla sodales nec.'),
