(3, 1, 'Skalmold', '/PrjWiki/BraveFrontierWiki/Skalmold/Francais', '/PrjWiki/PAGINE/Francois/Skalmold.php', 'De redoutables guerriers des territoires les plus froids de Grand Gaia. La légende raconte l\'histoire de six demi-dieux exceptionnels chargés de sélectionner les plus courageux des combattants mourants et de leur donner accès au paradis afin que leurs âmes puissent combattre aux côtés des dieux. Skalmold n\'est plus digne de son titre divin. traître à sa lignée, meurtrière de son amour, nul ne sait comment elle a réussi à éviter la mort.'),
